r\n以前爬山都要參加吃好住好 , 好走好爬 , 不背吃不背睡的稱之爽爽團  , 現在年紀愈大 , 感覺好像有些爽不起來 , 所以希望能找到樂樂團之類...\r\n\r\n\r\n\r\n本次南橫三星 , 感謝山友屋的安排 , 真的可稱之為樂樂團  , 只可惜體力不如從前 (已經到了三億人生的階段, (回憶 , 失意 , 腳沒力)) , 不過好家在 , 還是努力完成了 , 以下便是行程紀錄與感想 …\r\n\r\n是有多樂呢? 來聽聽看奧……\r\n\r\n1. 全程超輕裝.\r\n\r\n2. 專車接送到登山口.\r\n\r\n3. 不必起早 , 不必摸黑 .\r\n\r\n4. 兩天民宿 , 可以洗熱水澡 , 刷牙 , 吹電風 , 晚上喝冰啤 !!\r\n\r\n5. 軟床墊 ,  配大枕頭 .\r\n\r\n6. 每天換乾淨衣物 ,  加水果!!\r\n\r\n7. 冰水堤供 , 不必省水 , 不用帶熱水瓶 .\r\n\r\n8. 早出早歸 , 不用帶拖鞋 , 不用戴頭燈 .\r\n\r\n9. 早餐可以吃便利商店 , 晚餐可以吃原住民餐!\r\n\r\n10. Higher C/P , 2天可以摘三星 , 還百岳勒 .\r\n\r\n \r\n\r\n午餐就自製流浪者麵包嘍 , 如何 ? 不錯吧 !\r\n\r\n\r\n\r\n\r\n\r\nD0 集合點可以在高鐵站 , 但是還是百里迢迢到豐原 , 為的是吃這個海鮮粥 , 聽說有名 , 還算準是晚餐時間哩~~  飯後直奔民宿 .\r\n\r\n\r\n\r\n\r\n\r\nD1 七點前到梅山管制站前等交管 , 無聊吃著早餐閒逛這難得來一趟的玉管處南橫公路 ,\r\n\r\n梅山地質有砂岩(沉積岩)頁岩和硬頁岩(變質岩)為主 , 因泥沙堆積壓力變質 .\r\n\r\n動物有黑熊 , 山羌 , 水鹿 , 藍腹鷴 , 黃喉貂 , 長尾雉 , 野山羊等…  植物就多了, 蠻多的馬醉木和神木 .\r\n\r\n\r\n\r\n整個南橫景點有玉井綠色隧道 , 甲仙芋之鄉 , 寶來溫泉 , 天池長青祠 , 中之關步道 , 檜谷原始林 , 埡口大關山隧道 (長615M) , 觀雲海 , 利稻風景區… 如果不爬山的話 , 而且必須在下午五點前離開(兩點後禁止進入).\r\n\r\n\r\n\r\n7:52 到塔關山登山口 , 路程約2.2公里(共4.4公里 抓4小時) , 山頂不大 , 西為絕壁 , 東為板岩 , 南稜險瘦 , 可以睹關山大斷崖險惡風貌 , 沿途多為箭竹林 , 混生杉 , 山路多是交織的樹根組成 , 不時有聳立的巨木與碎石攀繩 .\r\n\r\n\r\n\r\n一路走會路過大關山駐在所遺址 , 日曬不強 , 走起來還算寫意 , 不吃力 , 而且無杖爬山 (因細故放了帶到登山杖) 沿路無驚險 , 但景色不單調  , 鐵杉神木蒼然深秀 .\r\n\r\n\r\n\r\n9:30登頂後 , 有個7535號三等三角點 , 號稱台灣山岳最佳展望點的塔關山頂 , 這大斷崖綿延一千多公尺的大崩坍岩場 , 瘦削的岩稜 , 破碎的岩壁 , 長年受風雪剝蝕 , 碎礫滾滾 , 直瀉數百公尺 直到谷底 .\r\n\r\n\r\n\r\n11:00 下山隨即午餐 , 麵包/橘子/軟糖 , 囫圇吞棗 , 抓緊時間 , 立刻驅車過大關山隧道(有交管) 3.5hrs vs 4hrs 嗯~~ 過關 ! PASS!!\r\n\r\n\r\n\r\n12:20 到關山嶺山登山口 , 路程約1.5公里 (共3公里,  抓3小時) 但單程爬升近450公尺 , 部分路段陡峭 , 攀爬峭壁石岩 , 拉繩上下 , 在稜線上視野開闊 , 有著 ”雲在山中游 , 山在雲裡走” 的交互感覺 , 沿途地形景觀多 , 鐵杉雲杉 , 玉山箭竹草原 , 富饒充斥整個山頭 , 同時日正當中 ,  黃乾土揚灰 , 飛沙走石 , 這段路不簡單 , 最後登頂前 , 很吃力.  \r\n\r\n\r\n\r\n埡口觀雲 , 隧道東西兩端分別在向陽面與背陽面 ,  隨地勢抬升 ,  將雲往大關山隧道上方的封口地形推擠 , 形成雲海與雲瀑 , 十分壯觀與變化多端 , 有時山頂發著金光(面陽光照射) 山腰卻翠綠 (背光) , 看起來非常漂亮 , 不是照片所能捕捉的 (2D vs 3D之差異), 要XR才行 .\r\n\r\n\r\n\r\n從埡口望上山的山客 , 就像一隻隻山羊一樣 , 攀爬在崖邊 , 好不驚恐 .\r\n\r\n從山上眺埡口的人群 , 就像一隻隻螞蟻一樣 , 漫步在地板 , 好不渺小 .\r\n\r\n這碎石坡像極了南湖大山進山屋那段 , 就差沒強風了可怕 @@\r\n\r\n過了拉繩 , 就是稜線 , 這一段並不輕鬆 , 大腿肌肉開始痠痛 , 這兩座山啊..\r\n\r\n \r\n\r\n塔關山 : 一是斜邊長約2公里 (往返約4.4公里) ,  高(對邊)約600公尺(642=2580-3222) .往返所一般需時間約4小時30分鐘。\r\n\r\n\r\n\r\n關山嶺山 : 斜邊長約1.5公里 (往返約3公里), 高(對邊) 約450公尺 (443=2733-3176) ,  往返所需時間約3小時 .\r\n\r\n算算啊 … 其夾角都是差不多陡的可怕 ,  難怪要拉繩 ,  難怪腿會痠 @@!\r\n\r\n\r\n\r\n結果13:50登頂 , 有顆二等1683號三角點，天氣大好 , 山出大景 , 陽光普照 , 山羊繞滿山頂 , 久不離去 , 待了一大會兒 , 才黃土飛揚滑下山去 , 好像去過沙漠一樣 !\r\n\r\n \r\n\r\n15:15 回到埡口 , 共約3小時 , 跟預判一樣 , OK! 今天共走了12.68公里,  24875步! 乖乖 !!\r\n\r\n\r\n\r\n\r\n\r\nD2 依樣6點起床 , 7點排隊 , 到梅山刷身分證 , 因為庫哈諾辛山是玉管處登記人數控管(約100人)的山頭 .\r\n\r\n7:53 在進涇橋出發牌牌照張像 , 才啟登就開始下雨了 , 其實據氣象昨就應該會下 ,  但沒下 , 算是天道酬勤(賺到) ,  現在下雨 , 算是地道籌善 (高雄缺水啊) .\r\n\r\n\r\n\r\n才一開始的600公尺 , 簡直是要命的陡 , 又斜坡 , 又攀繩 , 又下雨的… 喘個沒完 , 最高心率到178 ,  本路段也算是中央山脈主稜南一段( 代號CM600 全長44.9公里) 的途中 , 剛好碰到一隊人馬下山撤退 , 因天候關係決放棄南一段行程 , 此時更增加心理負擔 .\r\n\r\n\r\n\r\n尤其是這段上山到山屋之路 , 號稱有4000梯 (還是踢?) ,  一路上巨石 , 巨倒木砸壞了枕木梯 , 都必須繞道 , 或走天梯 , 或直接走上倒木越過之 , 增加一些困難的驚險度 !\r\n\r\n\r\n\r\n更有趣是  , 居然碰到山地警察 , 要求查驗入園證 , 這還第一次碰到耶 !?  聽說沒有入園證者  , 是會被要求下山並開罰的 ~~\r\n\r\n9:26 終於抵達庫哈諾辛山屋 (H3011), 只剩三勇士了(含領隊) , 吃個橘子 , 看一下瞭望台廁所 , 繼續出發 , 以免冷到 .\r\n\r\n原本以為南橫三星就是本區域最高之山峰了 , 沒想到旁邊的關山才是為首  ! 排名第12 (H3668) , 失敬失敬~~  而且來回要5小時左右 , 天啊 ! 比起來 ,  庫哈諾辛山算是親民了 .\r\n\r\n\r\n\r\n咬著牙 , 頂者歇雨 , 10:31 終於到山頂 , 一片預期的白牆 , 庫哈諾辛山有顆三等7534號三角點，晴天時山頂展望佳，可近觀南台一霸關山的雄峻山容。\r\n\r\n\r\n\r\n庫哈諾辛山是布農族發音 , 謂像燕子一樣的意思 , 只是不清楚燕子為何?\r\n\r\n沒待太久 , 啃完午餐麵包  , 就準備下山 , 回到山屋 , 剛好幸運地遇到新天山登山社高小姐 , 感謝提供好吃的鳳梨酥 , 貴鬆鬆的雞蛋 , 熱茶 , 好感動啊~~\r\n\r\n\r\n\r\n13:10左右 , 連滾帶爬 , 亦步亦趨 , 小心翼翼地走下山 , 下山梯滑路鬆 , 樹根濕 , 極不容易行走 , 再加上關節年久失修 , 只能慢步前進 .\r\n\r\n\r\n\r\n最後一段攀繩 , 因為繩子以吸飽水分 , 一時不察 , 想拉繩帥氣垂直迫降下滑 , 結果像扭毛巾一樣 , 黃水直衝衣褲 , 最後落得還要到橋下洗衣服 , 真慘~~~ (司機大哥會生氣) .\r\n\r\n\r\n\r\n庫哈諾辛山：往返約6.8公里，高度落差約746公尺(2368-3114)，一般往返所需時間6小時30分鐘 ,  結果因雨 , 我們反而在5小時完工 , 趕快回在五點前離開南橫 ,  順到甲仙去吃芋頭西米露 ,  還有芋頭冰 . 本日共走了11.62 公里, 23352 步 !!\r\n\r\n\r\n\r\n每次爬完百岳都好像脫一層皮一樣… 那是要怎麼辦呢 ?? 就是要像這樣嘍 ^^\r\n\r\n','\0JFIF\0\0\0\0\0\0\0\0\n\Z\Z\Z!.%+!&8&+/1555\Z$;@;4?.4514$!+4444444444444444444444444444444444444444444444444?\0\0\0\"\0\0\0\